import React from "react";
import NavBar from "./Nav-bar";
import Hero from "./Hero";
import About from "./about";
function App() {
  return (
    <div>
       <NavBar />
       <Hero />
       <main id="main">
         <About />
       </main>
    </div>

  );
}

export default App;
